import React from "react";
import { Container } from "react-bootstrap";
import mylist from "../fetchmylist";

function MyList({ movieDetails }) {
  // Check if movieDetails is undefined
  if (!movieDetails) {
    return null; // Return null if movieDetails is undefined
  }

  // Destructure properties from movieDetails


  const  mylistDetails = mylist();



  return (
    <>
    <Container>
      <br />
      <h1>Movies</h1>
      <Row>
        {mylistDetails.map((product) => (
          <Col key={product._id} sm={12} md={6} lg={4} xl={3}>
          </Col>
        ))}
      </Row>
    </Container>
    <Footer /> {/* Include Footer component here */}
  </>
  );
}

export default MyList;
